import React, { Component } from "react";
import Switch from "react-switch";

class ToggleButton extends Component {
  constructor() {
    super();
  }

  render() {
    return (
      <label>
        <Switch 
            onChange={this.props.onToggleFunction} 
            checked={this.props.checked} 
            />
      </label>
    );
  }
}

export default ToggleButton;
